import * as React from "react";
import { styled } from "@mui/material/styles";

import Table from "@mui/material/Table";
import Box from "@mui/material/Box";
import Grid from "@mui/material/Grid";

import Divider from "@mui/material/Divider";

import TableBody from "@mui/material/TableBody";
import TableCell from "@mui/material/TableCell";
import TableContainer from "@mui/material/TableContainer";
import TableHead from "@mui/material/TableHead";
import TableRow from "@mui/material/TableRow";
import Paper from "@mui/material/Paper";
import Typography from "@mui/material/Typography";

import Button from "@mui/material/Button";

import NavigateNextRoundedIcon from "@mui/icons-material/NavigateNextRounded";

const Item = styled(Paper)(({ theme }) => ({
  backgroundColor: theme.palette.mode === "dark" ? "#c2c2c2" : "#fff",
  ...theme.typography.body2,
  padding: theme.spacing(1),
  textAlign: "center",
  color: theme.palette.text.secondary,
}));

function createData(handWash, exterior, interior, deluxe) {
  return { handWash, exterior, interior, deluxe };
}

const carRows = [createData("$15", "$30", "$35", "$130")];
const truckRows = [createData("$20", "$40", "$45", "$140")];
const extTruckRows = [createData("$30", "$60", "$65", "$180")];
const vanRows = [createData("$40", "$80", "$85", "$250")];
const smallSuvRows = [createData("$25", "$40", "$45", "$140")];
const midSuvRows = [createData("$35", "$60", "$70", "$180")];
const fullSuvRows = [createData("$40", "$70", "$75", "$200")];

export default function BasicTable() {
  return (
    <Box id="price" sx={{ flexGrow: 1, color: "primary.contrastText" }}>
      <Divider>
        <Typography
          sx={{ display: { xs: "none", sm: "none", md: "flex"} }}
          variant="h2"
        >
          Detailing Prices
        </Typography>
        <Typography
          sx={{ display: { xs: "none", sm: "flex", md: "none", xl: "none" } }}
          variant="h4"
        >
          Detailing Prices
        </Typography>
        <Typography
          sx={{ display: { xs: "flex", sm: "none", md: "none" }, fontSize: "2rem" }}
          variant="h6"
        >
          Detailing Prices
        </Typography>
      </Divider>

      <Grid
        container
        spacing={2}
        direction="row"
        justifyContent="center"
        alignItems="center"
      >
        {/*//=========== GRID BOX START =================================> */}
        <Grid item xs={12} sm ={11} md={6} lg={4} xl={3} >
          <Item sx={{ bgcolor: "primary.light", color: "primary.contrastText"}}>
            <Divider
              variant="middle" 
              light={true}
              >
              <Typography
                variant="h6"
                sx={{
                  fontWeight: 700,
                }}
              >
                Car
              </Typography>
            </Divider>

            {/* === === === === === CAR TABLE CONTAINER === === === === ===  */}
            <TableContainer component={Paper}>
              <Table
                sx={
                  {
                    /*INSERT CSS  */
                  }
                }
                aria-label="simple table"
              >
                <TableHead>
                  <TableRow>
                    <TableCell align="center">Hand Wash</TableCell>
                    <TableCell align="center">Interior Detail</TableCell>
                    <TableCell align="center">Exterior Detail</TableCell>
                    <TableCell align="center">Deluxe Detail**</TableCell>
                  </TableRow>
                </TableHead>
                <TableBody>
                  {carRows.map((row) => (
                    <TableRow
                      bgColor="#b0bec9"
                      key={row.name}
                      sx={{ "&:last-child td, &:last-child th": { border: 0 }}}
                    >
                      <TableCell sx={{color:"white"}} align="center">{row.handWash}</TableCell>
                      <TableCell align="center">{row.exterior}</TableCell>
                      <TableCell align="center">{row.interior}</TableCell>
                      <TableCell align="center">{row.deluxe}</TableCell>
                    </TableRow>
                  ))}
                </TableBody>
              </Table>
            </TableContainer>
          </Item>
        </Grid>

        {/*//=========== GRID BOX START =================================> */}
        <Grid item xs={12} sm ={11} md={6} lg={4} xl={3} >
          <Item sx={{ bgcolor: "primary.light", color: "primary.contrastText"}}>
            <Divider>
              <Typography
                variant="h6"
                sx={{
                  fontWeight: 700,
                }}
              >
                Regular Cab Truck
              </Typography>
            </Divider>

            {/* === === === === === === TABLE CONTAINER === === === === === === ===  */}
            <TableContainer component={Paper}>
              <Table
                sx={
                  {
                    /*INSERT CSS  */
                  }
                }
                aria-label="simple table"
              >
                <TableHead>
                  <TableRow>
                    <TableCell align="center">Hand Wash</TableCell>
                    <TableCell align="center">Interior Detail</TableCell>
                    <TableCell align="center">Exterior Detail</TableCell>
                    <TableCell align="center">Deluxe Detail**</TableCell>
                  </TableRow>
                </TableHead>
                <TableBody>
                  {truckRows.map((row) => (
                    <TableRow
                      bgColor="primary.main"
                      key={row.name}
                      sx={{ "&:last-child td, &:last-child th": { border: 0 } }}
                    >
                      <TableCell align="center">{row.handWash}</TableCell>
                      <TableCell align="center">{row.exterior}</TableCell>
                      <TableCell align="center">{row.interior}</TableCell>
                      <TableCell align="center">{row.deluxe}</TableCell>
                    </TableRow>
                  ))}
                </TableBody>
              </Table>
            </TableContainer>
          </Item>
        </Grid>

        {/*//=========== GRID BOX START =================================> */}
        <Grid item xs={12} sm ={11} md={6} lg={4} xl={3} >
          <Item sx={{ bgcolor: "primary.light", color: "primary.contrastText"}}>
            <Divider>
              <Typography
                variant="h6"
                sx={{
                  fontWeight: 700,
                }}
              >
                Extended Cab Truck
              </Typography>
            </Divider>

            {/* === === === === === === TABLE CONTAINER === === === === === === ===  */}
            <TableContainer component={Paper}>
              <Table
                sx={
                  {
                    /*INSERT CSS  */
                  }
                }
                aria-label="simple table"
              >
                <TableHead>
                  <TableRow>
                    <TableCell align="center">Hand Wash</TableCell>
                    <TableCell align="center">Interior Detail</TableCell>
                    <TableCell align="center">Exterior Detail</TableCell>
                    <TableCell align="center">Deluxe Detail**</TableCell>
                  </TableRow>
                </TableHead>
                <TableBody>
                  {extTruckRows.map((row) => (
                    <TableRow
                      bgColor="primary.main"
                      key={row.name}
                      sx={{ "&:last-child td, &:last-child th": { border: 0 } }}
                    >
                      <TableCell align="center">{row.handWash}</TableCell>
                      <TableCell align="center">{row.exterior}</TableCell>
                      <TableCell align="center">{row.interior}</TableCell>
                      <TableCell align="center">{row.deluxe}</TableCell>
                    </TableRow>
                  ))}
                </TableBody>
              </Table>
            </TableContainer>
          </Item>
        </Grid>

        {/*//=========== GRID BOX START =================================> */}
        <Grid item xs={12} sm ={11} md={6} lg={4} xl={3} >
          <Item sx={{ bgcolor: "primary.light", color: "primary.contrastText"}}>
            <Divider>
              <Typography
                variant="h6"
                sx={{
                  fontWeight: 700,
                }}
              >
                Van
              </Typography>
            </Divider>

            {/* === === === === === === TABLE CONTAINER === === === === === === ===  */}
            <TableContainer component={Paper}>
              <Table
                sx={
                  {
                    /*INSERT CSS  */
                  }
                }
                aria-label="simple table"
              >
                <TableHead>
                  <TableRow>
                    <TableCell align="center">Hand Wash</TableCell>
                    <TableCell align="center">Interior Detail</TableCell>
                    <TableCell align="center">Exterior Detail</TableCell>
                    <TableCell align="center">Deluxe Detail**</TableCell>
                  </TableRow>
                </TableHead>
                <TableBody>
                  {vanRows.map((row) => (
                    <TableRow
                      bgColor="primary.main"
                      key={row.name}
                      sx={{ "&:last-child td, &:last-child th": { border: 0 } }}
                    >
                      <TableCell align="center">{row.handWash}</TableCell>
                      <TableCell align="center">{row.exterior}</TableCell>
                      <TableCell align="center">{row.interior}</TableCell>
                      <TableCell align="center">{row.deluxe}</TableCell>
                    </TableRow>
                  ))}
                </TableBody>
              </Table>
            </TableContainer>
          </Item>
        </Grid>

        {/*//=========== GRID BOX START =================================> */}
        <Grid item xs={12} sm ={11} md={6} lg={4} xl={3} >
          <Item sx={{ bgcolor: "primary.light", color: "primary.contrastText"}}>
            <Divider>
              <Typography
                variant="h6"
                sx={{
                  fontWeight: 700,
                }}
              >
                Small SUV
              </Typography>
            </Divider>

            {/* === === === === === === TABLE CONTAINER === === === === === === ===  */}
            <TableContainer component={Paper}>
              <Table
                sx={
                  {
                    /*INSERT CSS  */
                  }
                }
                aria-label="simple table"
              >
                <TableHead>
                  <TableRow>
                    <TableCell align="center">Hand Wash</TableCell>
                    <TableCell align="center">Interior Detail</TableCell>
                    <TableCell align="center">Exterior Detail</TableCell>
                    <TableCell align="center">Deluxe Detail**</TableCell>
                  </TableRow>
                </TableHead>
                <TableBody>
                  {smallSuvRows.map((row) => (
                    <TableRow
                      bgColor="primary.main"
                      key={row.name}
                      sx={{ "&:last-child td, &:last-child th": { border: 0 } }}
                    >
                      <TableCell align="center">{row.handWash}</TableCell>
                      <TableCell align="center">{row.exterior}</TableCell>
                      <TableCell align="center">{row.interior}</TableCell>
                      <TableCell align="center">{row.deluxe}</TableCell>
                    </TableRow>
                  ))}
                </TableBody>
              </Table>
            </TableContainer>
          </Item>
        </Grid>

        {/*//=========== GRID BOX START =================================> */}
        <Grid item xs={12} sm ={11} md={6} lg={4} xl={3} >
          <Item sx={{ bgcolor: "primary.light", color: "primary.contrastText"}}>
            <Divider>
              <Typography
                variant="h6"
                sx={{
                  fontWeight: 700,
                }}
              >
                Mid-Size SUV
              </Typography>
            </Divider>

            {/* === === === === === === TABLE CONTAINER === === === === === === ===  */}
            <TableContainer component={Paper}>
              <Table
                sx={
                  {
                    /*INSERT CSS  */
                  }
                }
                aria-label="simple table"
              >
                <TableHead>
                  <TableRow>
                    <TableCell align="center">Hand Wash</TableCell>
                    <TableCell align="center">Interior Detail</TableCell>
                    <TableCell align="center">Exterior Detail</TableCell>
                    <TableCell align="center">Deluxe Detail**</TableCell>
                  </TableRow>
                </TableHead>
                <TableBody>
                  {midSuvRows.map((row) => (
                    <TableRow
                      bgColor="primary.main"
                      key={row.name}
                      sx={{ "&:last-child td, &:last-child th": { border: 0 } }}
                    >
                      <TableCell align="center">{row.handWash}</TableCell>
                      <TableCell align="center">{row.exterior}</TableCell>
                      <TableCell align="center">{row.interior}</TableCell>
                      <TableCell align="center">{row.deluxe}</TableCell>
                    </TableRow>
                  ))}
                </TableBody>
              </Table>
            </TableContainer>
          </Item>
        </Grid>

        {/*//=========== GRID BOX START =================================> */}
        <Grid item xs={12} sm ={11} md={6} lg={4} xl={3} >
          <Item sx={{ bgcolor: "primary.light", color: "primary.contrastText"}}>
            <Divider>
              <Typography
                variant="h6"
                sx={{
                  fontWeight: 700,
                }}
              >
                Full-Size SUV
              </Typography>
            </Divider>

            {/* === === === === === === TABLE CONTAINER === === === === === === ===  */}
            <TableContainer component={Paper}>
              <Table
                sx={
                  {
                    /*INSERT CSS  */
                  }
                }
                aria-label="simple table"
              >
                <TableHead>
                  <TableRow>
                    <TableCell align="center">Hand Wash</TableCell>
                    <TableCell align="center">Interior Detail</TableCell>
                    <TableCell align="center">Exterior Detail</TableCell>
                    <TableCell align="center">Deluxe Detail**</TableCell>
                  </TableRow>
                </TableHead>
                <TableBody>
                  {fullSuvRows.map((row) => (
                    <TableRow
                      bgColor="primary.main"
                      key={row.name}
                      sx={{ "&:last-child td, &:last-child th": { border: 0 } }}
                    >
                      <TableCell align="center">{row.handWash}</TableCell>
                      <TableCell align="center">{row.exterior}</TableCell>
                      <TableCell align="center">{row.interior}</TableCell>
                      <TableCell align="center">{row.deluxe}</TableCell>
                    </TableRow>
                  ))}
                </TableBody>
              </Table>
            </TableContainer>
          </Item>
        </Grid>

        {/*//=============== GRID END GOES TO BOTTOM  =====================> */}
      </Grid>
    </Box>
  );
}
